import React from "react";
import HeroMain from "./HeroMain";

const Hero = () => {
  return (
    <div className="flex flex-col items-center pt-28  -z-20">
      <HeroMain />
      <p>Your way too Victory</p>
    </div>
  );
};

export default Hero;
